import mixin from 'BlockChain-ui-privatization/PC/common-mixin/broker/view/view';
import 'BlockChain-ui-privatization/PC/common-mixin/broker/view/view.styl';
import { getCoinShowName } from 'BlockChain-ui-privatization/utils';
export default {
  mixins: [mixin],
  mounted: function mounted() {
    this.init();
  },
  computed: {
    columns: function columns() {
      return [{
        title: this.$t('broker.time'),
        width: '100px'
      }, {
        title: this.$t('broker.scale') // '返佣比例',

      }, {
        title: "".concat(this.$t('broker.fee'))
      }, {
        title: "".concat(this.$t('broker.amount'), "(").concat(getCoinShowName(this.bonusCoinName, this.coinList), ")")
      }];
    }
  }
};
